# Project information
site_name: LeetCode Solutions
site_description: LeetCode Solutions in C++, Java, and Python.
site_author: Jay Chen
site_url: https://walkccc.github.io/LeetCode

# Repository
repo_name: walkccc/LeetCode
repo_url: https://github.com/walkccc/LeetCode

# Copyright
copyright: Built by <a href="http://github.com/walkccc">Jay Chen</a> &copy; 2019 - 2020

# Configuration
theme:
  name: material
  language: en
  custom_dir: custom
  favicon: assets/favicon.png
  palette:
    primary: teal
    accent: blue
  font:
    text: Roboto
    code: Roboto Mono
  icon:
    logo: fontawesome/solid/code
    repo: fontawesome/brands/github
  features:
    - tabs

# Customization
extra:
  social:
    - icon: fontawesome/brands/github-square
      link: https://github.com/walkccc
    - icon: fontawesome/brands/linkedin
      link: https://www.linkedin.com/in/peng-yu-jay-chen-57852313a
    - icon: material/book-open-page-variant
      link: https://walkccc.github.io/CLRS

extra_css:
  - css/katex.css
  - css/custom.css
  - https://cdn.jsdelivr.net/npm/katex@0.11.1/dist/katex.min.css

extra_javascript:
  - js/katex.js
  - https://cdn.jsdelivr.net/npm/katex@0.11.1/dist/katex.min.js
  - https://cdn.jsdelivr.net/npm/katex@0.11.1/dist/contrib/auto-render.min.js

# Google Analytics
google_analytics:
  - UA-117404761-3
  - auto

# Extensions
markdown_extensions:
  - toc:
      permalink: false
  - pymdownx.highlight:
      linenums: true
      linenums_style: pymdownx-inline
  - pymdownx.tasklist:
      custom_checkbox: true
  - pymdownx.emoji:
      emoji_index: !!python/name:pymdownx.emoji.twemoji
      emoji_generator: !!python/name:pymdownx.emoji.to_svg
  - pymdownx.superfences
  - pymdownx.mark

